// eslint-disable-next-line
import React from 'react';

import TodoListItem from './todo-list-item'


const ToDoList = () => {
    return (<ul>
        <li><TodoListItem label='Coffeee!!!!'/> </li>
        <li><TodoListItem label='Make a dinner!'/></li>
    </ul>)
}
export default ToDoList;
